import { Component } from 'react';
import ReactMapGL, {Marker} from 'react-map-gl';
import * as parkDate from '../data/downloads.json';


// a simple Map component
class Map extends Component {

  // Position initial of the map 
  state = {
    viewport: {
      width: '100vw',
      height: '100vh',
      latitude: 45.4211,
      longitude: -75.6903,
      zoom: 10
    }

  };

  render() 
  {

    return (
      <ReactMapGL
        mapStyle="mapbox://styles/mapbox/streets-v9"
        mapboxApiAccessToken="pk.eyJ1IjoiYWxleGVuYXgiLCJhIjoiY2tiMmVmZ2I4MDZ6dTJ1czBwYnpqOGtxcCJ9.IBNl_OPjhbhwcMbTycNL3w"
        mapStyle="mapbox://styles/alexenax/ckb2fqmm606pj1ir103dxqxdc"
        onViewportChange={(viewport) => this.setState({ viewport })}
        {...this.state.viewport}
      >

      {parkDate.features.map(park => (
        <Marker key={park.properties.PARK_ID} 
                latitude={park.geometry.coordinates[1]}
                longitude={park.geometry.coordinates[0]}
        >
            <button className="marker-btn">
              <img src="/home.svg" alt="Home Icon"></img>
            </button>
        </Marker>
      ))}

      </ReactMapGL>
    );
  }
}

export default Map;
